import './App.css'
import 'bootstrap/dist/css/bootstrap.min.css'


function App() {
  const styleObj = {
    color: 'red'
  }
  const element = (
  <nav className="navbar navbar-expand navbar-dark bg-dark">
    Foo
    <div style={styleObj} className="navbar-nav mr-auto">
      <li className="nav-item">
        This is
      </li>
    </div>
  </nav>
);
  return (
    <div className="App">
      <header className="App-header">
        {element}
      </header>
    </div>
  );
}

export default App
